import React from 'react';
import { Tag } from 'antd';

const TagList = ({ tags }) => {
    return (
        <div>
            <div>tags</div>
            {(tags || []).map((item) => (
                <Tag key={item.key}>{item.label}</Tag>
            ))}
        </div>
    )
}

export default TagList
